import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First add an item to cart since cart is empty
    await page.waitForSelector('.product-card');
    await page.click('.product-card:first-child .add-to-cart');

    // Wait for cart to update and notification to appear
    await page.waitForSelector('.notification.success');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Update quantity by clicking the plus button
    await page.click('.cart-item:first-child .quantity-btn:last-of-type');

    // Wait for quantity to update
    await page.waitForFunction(() => {
      const quantityElement = document.querySelector('.cart-item:first-child .quantity');
      return quantityElement && quantityElement.textContent === '2';
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // Extract cart data to verify update
    const cartData = await page.evaluate(() => {
      const items = document.querySelectorAll('.cart-item');
      return Array.from(items).map(item => ({
        title: item.querySelector('.cart-item-title').textContent,
        quantity: parseInt(item.querySelector('.quantity').textContent),
        price: item.querySelector('.cart-item-price').textContent
      }));
    });

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData: {
        cartItems: cartData,
        totalItems: cartData.reduce((sum, item) => sum + item.quantity, 0)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
